import React from "react";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

//Header and Footer
import Header from "../../components/Headers/VideosHeader";
import Footer from "../../components/Footers/HomeFooter";

//Side Navigation
import TabContainer from "react-bootstrap/TabContainer";
import TabContent from "react-bootstrap/TabContent";
import TabPane from "react-bootstrap/TabPane";
import Nav from "react-bootstrap/Nav";

//Sections
import TeddyBearSection from "./Sections/TeddyBear";

class Videos extends React.Component {
  constructor(props) {
    super(props);

    var defaultKey = "teddybear";

    this.state = {
      key: defaultKey,
    };
  }

  handleSelectKey = (keySelect) => {
    this.setState({ key: keySelect });
  };

  render() {
    return (
      <div class="container">
        <Header activeKey="/videos" />
        <TabContainer defaultActiveKey={this.defaultKey}>
          <Row>
            <Col md={3}>
              <Nav
                fill
                variant="tabs"
                bg="secondary"
                activeKey={this.state.key}
              >
                <Nav.Item>
                  <Nav.Link eventKey="teddyBear">Teddy Bear</Nav.Link>
                </Nav.Item>
              </Nav>
            </Col>
            <Col md={9}>
              <TabContent>
                <TabPane eventKey="teddyBear">
                  <TeddyBearSection />
                </TabPane>
              </TabContent>
            </Col>
          </Row>
        </TabContainer>
        <Footer />
      </div>
    );
  }
}

export default VideosPage;
